import { FC, ReactNode } from "react";

import icon1 from "./../../../utils/icon1.png";
import icon2 from "./../../../utils/icon2.png";
import icon3 from "./../../../utils/icon3.png";
import icon4 from "./../../../utils/icon4.png";
import icon5 from "./../../../utils/icon5.png";
import icon6 from "./../../../utils/icon6.png";

import { UserIcon } from "./styles";

export let arrIcons = [icon1, icon2, icon3, icon4, icon5, icon6];
type Icons = "icon1" | "icon2" | "icon3" | "icon4" | "icon5" | "icon6";

type UserIconProps = {
  icon: string;
};

export const Icon: FC<UserIconProps> = ({ icon }) => {
  if (icon === "icon1") return <UserIcon icon={icon1} />;
  if (icon === "icon2") return <UserIcon icon={icon2} />;
  if (icon === "icon3") return <UserIcon icon={icon3} />;
  if (icon === "icon4") return <UserIcon icon={icon4} />;
  if (icon === "icon5") return <UserIcon icon={icon5} />;
  if (icon === "icon6") return <UserIcon icon={icon6} />;
  return <div />;
};
